import Editor from 'C:\kpii\KYRSACH\note_app\client\ckeditor5\src\ckeditor.js';
//import {Editor as ClassicEditor} from 'ckeditor5-custom-build/build/ckeditor';
import { CKEditor } from '@ckeditor/ckeditor5-react'
import React from "react";

const Editorr = (props) => {
  const { body, setBody } = props;
  return (
    <div className="w-full mx-auto mt-4 leading-normal text-primary-default editor">
      <CKEditor
        editor={Editor}
        data={body}
        onReady={(editor) => { console.log('Editor is ready to use!', editor);}}
        onChange={(event, editor) => {
          const data = editor.getData();
          setBody(data);
          console.log({ event, editor, data });
        }}
        onBlur={(event, editor) => {console.log('Blur.', editor);}}
        onFocus={(event, editor) => {console.log('Focus.', editor);}}
      />
    </div>

  );
};
export default Editorr;
